    update = function(userid) {
        if(!(userid in data)) {
            alert('データに含まれないユーザーIDです');
            return;
        }
        var rlist = $('<ol id="rec_list">');
        $.each(data[userid]['item'], function(i, v) {
            rlist.append('<li><a href="http://judge.u-aizu.ac.jp/onlinejudge/description.jsp?id=' + v + '">' + v + '</a></li>');
        });
        var ulist = $('<ol id="user_list">');
        $.each(data[userid]['user'], function(i, v) {
            ulist.append('<li><a href="javascript:void(0);" onclick="update(\'' + v + '\');">' + v + '</a></li>');
        });


        $('#user').remove();
        $('#rec_list').remove();
        $('#user_list').remove();
        $('#sim_user').before('<p id="user"><a href="http://judge.u-aizu.ac.jp/onlinejudge/user.jsp?id=' + userid + '">' + userid + '</a></p>');
        $('#rec').after(rlist);
        $('#sim_user').after(ulist);
    };
    update('mugenen');
    $('#suggest').click(function(){
        update($('#username').val());
    });
    $('#username').keypress(function(event) {
        if (event.keyCode == 10 || event.keyCode == 13) {
            update($('#username').val());
            event.preventDefault();
        }
    });
});
</script>
